  false,\n\t\"url\": null,\n\t\"notes\": \"The ongoing studies discussed here assess
  the current status of the taiga merlin in central Alaska, present preliminary findings
  on the extent of pesticide contamination and provide basic information on the Alaskan
  merlin population. During the 1983 field season, many areas were searched for nesting
  merlins. Denali National Park was selected as a study site for ongoing work and
  searched extensively during May 1984 for nesting merlins.\",\n\t\"license_title\":
